import { Navbar, Nav } from "react-bootstrap";
import './Header.css'

class Header extends Component {
    constructor() {
        super();
    }
      onLogoutClick = e => {
    e.preventDefault();
    this.props.logoutUser();
  };

    render() {
        return (
<div className="navbar">   <Navbar collapseOnSelect expand="lg" bg="dark" variant="dark">  //    <button
              style={{
                width: "150px",
                borderRadius: "3px",
                letterSpacing: "1.5px",
                marginTop: "1rem"
              }}
              onClick={this.onLogoutClick}
              className="btn btn-large waves-effect waves-light accent-3"
            >
              Logout
            </button>
</Navbar></div>
        )
    }
}


export default Header;
